'''North End''' refers to the northern section of the city of [[Moria|Khazad-dûm]].  Located here was the [[Twenty-first Hall]], which was a important population center for [[Balin's Colony]].  Also located here was the [[Chamber of Mazarbul]]. The [[Fellowship of the Ring|Fellowship]] camped in that section on their journey through Moria.<ref>{{FR|II5}}</ref>
